var entriesAuthCategory = [];
cy.api({ url: "https://api.publicapis.org/entries" }, "GET Entries and filter by the Category: Authentication & Authorization").then(function (responseEntries) {
    expect(responseEntries.status).to.eq(200);
    assert.isArray(responseEntries.body.entries, "Todos Response is an array");
    responseEntries.body.entries.forEach(function (entry) {
        if (entry.Category === "Authentication & Authorization") {
            entriesAuthCategory.push(entry);
        }
    });
    expect(entriesAuthCategory.length).to.be.equals(7);
    cy.log(entriesAuthCategory.length);
    entriesAuthCategory.forEach(function (entry) {
        cy.log(JSON.stringify(entry));
        cy.wrap(entry).should((0, cy_spok_1.default)({
            API: cy_spok_1.default.string,
            Description: cy_spok_1.default.string,
            Auth: cy_spok_1.default.string,
            HTTPS: cy_spok_1.default.type("boolean"),
            Cors: cy_spok_1.default.string,
            Link: cy_spok_1.default.string,
            Category: "Authentication & Authorization",
        }));
    });
});
